    value: 'There is a payroll check to Leigh Ann Herold on 2/11/10 for $1,166.67
      and then 2 voided checks, 2/12/10 for $934.81 and 2/25/10 for $216.68 that represent
      a partial void of the full check. Paychecks are direct deposited through the
      payroll company, ADP. ADP had to void in 2 separate transactions for the payroll
      tax portion and the net paycheck portion. Ms Herold ultimately received a check
      for $15.18. The negative disbursements for Charlie Crist for US Senate Campaign
      are not voided checks, they represent copy charge purchases and equipment purchases.
      The operating expenses of the Committee were all paid by the Committee as admin
      allocated activity and therefore, the purchase of these items is recorded as
      such. No expenditure, other than a direct contribution or exempt activity so
      identified, was made on behalf of a specifically identified federal candidate.
      No expenditure not identified as such was for a public communication that referred
      to a clearly identified candidate for Federal office and that promoted, supported,
      attacked or opposed any such candidate for Federal office. All expenditures
      to individuals for rent represent rent income to those individuals and arent
      required to be itemized. All disbursements for salaries and benefits disclosed
      on Schedule H4 are for employees who did not spend more than 25% of their compensated
      time during the reporting period on Fed election activities or activities in
      connection with a Federal election. All transfers for allocated activity reported
      on Sch H3 occurred within the 70-day permitted window of time. The Committee
      uses the Escrow option for receipt of corporate in-kind donations as provided
      for by the Commission in Advisory Opinion 1992-33. The method ensures that prohibited
      sources are not used to fund the federal share of allocable activity expenses.
      In-kind details and the escrow account activity are summarized as follows:   Admin
      Acct: 1/1/10 Admin escrow balance $593.85 (as reflected on amended prior report)   1/4/10
      and 2/4/10 Yuma Solutions in-kinds of $4,000 each as reflected on Sch H4 and
      transfers on Sch H3 using $1,680 of escrow balance.  2/19/10 transfer to Admin
      escrow account of $900 as reflected on Sch H4.  3/4/10 Yuma Solutions in-kind
      of $4,000 as reflected on Sch H4 and transfer on Sch H3 using $840 of escrow
      balance.  3/30/10 transfer to Admin escrow account of $1,341.90 as reflected
      on Sch H4.  3/31/10 Admin escrow balance of $315.75  1/1/10 and 3/31/10 MD-10B
      escrow account balance is $1,342.18. Combined escrow balance is $1,657.93.  Amended
      report to correct codings from Administrative to Voter Drive for polling costs.  '
